import React from 'react'
import { FaFacebookSquare,FaLinkedin } from 'react-icons/fa';
import {IoLogoYoutube} from 'react-icons/io';
import { AiFillInstagram } from 'react-icons/ai';

const Footer = () => {
    return (
        <footer id="sticky-footer" className="bg-light text-dark-50">
            <div className="container py-1">
                <div className="row">
                    <div className="col-md-6 col-12 my-auto">
                        <small>Copyright &copy; Tosh Developer</small>
                    </div>
                    <div className="col-md-6 col-12">
                        <div className="d-flex float-right">
                            <a href="https://github.com/yourusername" target="_blank">GitHub</a><br />
                            <a href="https://www.instagram.com/yourusername" target="_blank">Instagram</a><br />
                            <a href="https://www.linkedin.com/in/yourusername" target="_blank">LinkedIn</a><br />
                            <a href="https://www.tiktok.com/@yourusername" target="_blank">TikTok</a><br />
                        </div>
                    </div>
                </div>
            </div>
        </footer>
    )
}
export default Footer;
